@Acquamarina **** Экстраклассов....в стране что либо поменялось в результате деятельности всех этих экстраклассов? Или в твоей лично? Я не вижу никаких изменений, а вижу только тупую биомассу, которая вместо того что бы выйти с требованиями, сидит и смотрит экстраклассов счет которых пошел уже за сотни и которые говорят из пустого в порожню правильные и хорошие вещи. Осталось только поаплодировать онлайн и поставить лайк.
Ты завтра уже забудешь,что говорил этот экстракласс,ибо завтра будешь смотреть другого экстракласса.
А твои киселя и соловья меня не интересуют.
